import { UserContext } from './context/UserContext';

export const LoginPage = () => {

  //llamo al context para usar las propiedades
  // desestructuro para tomar solo las propiedades que requiero
  const {user} = useContext (UserContext);


  return (
    <>
        <h1>Login Page</h1>
        <hr/>

    <pre>
      { JSON.stringify(user, null, 3)}
    </pre>
    </>
  )
}
